var $bm_rt;
var srcLayer = thisComp.layer('Top Loop');
var srcPath = srcLayer('ADBE Root Vectors Group')('Group 1')('ADBE Vectors Group')('Path 1')('ADBE Vector Shape');
var sliderType = effect('Points Toggle')(1).value;
var loc = $bm_div(effect('Location')(1), 100);
var norm = !sliderType ? srcPath.normalOnPath($bm_mod($bm_sum($bm_mod(loc, 1), 1), 1)) : [
    0,
    0
];
var angl = Math.atan2(norm[1], norm[0]);
$bm_rt = $bm_sum(value, radiansToDegrees(angl));

p.x:
var $bm_rt;
var srcLayer = thisComp.layer('Top Loop');
var srcPath = srcLayer('ADBE Root Vectors Group')('Group 1')('ADBE Vectors Group')('Path 1')('ADBE Vector Shape');
var sliderType = effect('Points Toggle')(1).value;
var loc = effect('Location')(1);
if (!sliderType) {
    var p = srcLayer.toComp(srcPath.pointOnPath($bm_mod($bm_sum($bm_mod($bm_div(loc, 100), 1), 1), 1)));
} else {
    var num = srcPath.points().length;
    var p = srcLayer.toComp(srcPath.points()[Math.round($bm_mul($bm_mod($bm_sum($bm_mod($bm_div(loc, num), 1), 1), 1), num))]);
}
$bm_rt = $bm_sum(p, value);

